// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IUniswapV2Router {
    function getAmountsOut(uint amountIn, address[] calldata path) external view returns (uint[] memory amounts);
    function swapExactTokensForTokens(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline) external returns (uint[] memory amounts);
}

interface IUniswapV2Pair {
    function token0() external view returns (address);
    function token1() external view returns (address);
}

contract ImprovedSlippageBot is Ownable {
    IUniswapV2Router public uniswapRouter;
    IERC20 public token;
    
    event LiquidityCheck(address indexed pair, uint liquidity);
    event TokenSwapped(address indexed sender, uint amountIn, uint amountOut);
    event Withdrawal(address indexed owner, uint amount);

    constructor(address _uniswapRouter, address _token) Ownable(msg.sender) {
        uniswapRouter = IUniswapV2Router(_uniswapRouter);
        token = IERC20(_token);
    }

    modifier hasSufficientTokens(uint amount) {
        require(token.balanceOf(msg.sender) >= amount, "Insufficient token balance");
        _;
    }

    // Function to check liquidity of a pair
    function checkLiquidity(address pair) public view returns (uint liquidity) {
        address token0 = IUniswapV2Pair(pair).token0();
        address token1 = IUniswapV2Pair(pair).token1();

        uint token0Balance = IERC20(token0).balanceOf(pair);
        uint token1Balance = IERC20(token1).balanceOf(pair);

        liquidity = token0Balance > token1Balance ? token0Balance : token1Balance;
    }

    // Function to swap tokens using Uniswap
    function swapTokens(
        address[] memory path,
        uint amountIn,
        uint amountOutMin
    ) public hasSufficientTokens(amountIn) {
        // Transfer tokens from the user to the contract
        token.transferFrom(msg.sender, address(this), amountIn);

        // Approve the Uniswap router to spend the tokens
        token.approve(address(uniswapRouter), amountIn);

        // Get expected output
        uint[] memory amountsOut = uniswapRouter.getAmountsOut(amountIn, path);
        require(amountsOut[amountsOut.length - 1] >= amountOutMin, "Slippage too high");

        // Perform the swap
        uniswapRouter.swapExactTokensForTokens(
            amountIn,
            amountsOut[amountsOut.length - 1],
            path,
            msg.sender,
            block.timestamp
        );

        emit TokenSwapped(msg.sender, amountIn, amountsOut[amountsOut.length - 1]);
    }

    // Owner-only function to withdraw tokens from the contract
    function withdraw(uint amount) public onlyOwner {
        uint contractBalance = token.balanceOf(address(this));
        require(contractBalance >= amount, "Insufficient contract balance");

        token.transfer(msg.sender, amount);

        emit Withdrawal(msg.sender, amount);
    }

    // Receive function to accept Ether
    receive() external payable {}

    // Owner-only function to set the Uniswap router address
    function setUniswapRouter(address _uniswapRouter) external onlyOwner {
        uniswapRouter = IUniswapV2Router(_uniswapRouter);
    }

    // Owner-only function to set the token address
    function setToken(address _token) external onlyOwner {
        token = IERC20(_token);
    }
}

